import axios from "axios";
import React from "react";
const url = "http://localhost:8000/api";

function Get() {

    const [data, setData] = React.useState([]);

    React.useEffect(() => {
        axios.get(url).then((res) => {
            const data = res.data;
            setData(data);
        });
    }, []);



    return (
        <div>
            <h1>Contact</h1>
            <div>

                {data.map((item) => (                 
                    <div key={item._id} style={{
                        display: "inline-block",
                        border: "1px solid black",
                        borderRadius: "5px",
                        width: "90%",
                        padding: "10px",
                        margin: "10px"
                    }}>
                        <div style={styles.box_contact}>
                            <label>First Name: </label>
                            {item.contact.name}
                        </div>
                        <div style={styles.box_contact}>
                            <label>Email : </label>
                            {item.contact.email}
                        </div>
                        <div style={styles.box_contact}>
                            <label>Phone : </label>
                            {item.contact.phone}
                        </div>
                   </div>
                ))}
            </div>
        </div>
    )
}

const styles = {
    box_contact: {
        padding: "5px",
        display: "flex",
        float : "left",
    }
}

export default Get;
